pragma solidity ^0.8.20;

/**
 * A naive contract that tries to store a file's checksum
 * but doesn't verify it properly.
 */
contract NaiveChecksum {
    bytes32 public storedChecksum;

    function storeChecksum(bytes32 checksum) external {
        // ❌ Anyone can store any hash, no actual verification of real data
        storedChecksum = checksum;
    }

    function verifyData(bytes memory data) external view returns (bool) {
        // ❌ Just compares naive hash with keccak256
        return (keccak256(data) == storedChecksum);
    }
}

